package com.example.uptop.pandorikatest.rest.model;import com.google.gson.annotations.SerializedName;import java.util.ArrayList;import java.util.List;public class RecordingsModel {    @SerializedName("resultCount")    private Integer resultCount;    @SerializedName("results")    private List<ItemResultRecordings> results = new ArrayList<ItemResultRecordings>();    public Integer getResultCount() {        return resultCount;    }    public void setResultCount(Integer resultCount) {        this.resultCount = resultCount;    }    public List<ItemResultRecordings> getResults() {        return results;    }    public void setResults(List<ItemResultRecordings> results) {        this.results = results;    }}